import React, {Component} from "react"

export default class UserTableRow extends Component
{
    constructor(props) {
        super(props)
    }


    render() {
        const {
            name,
            email,
            accessLevel,
        } = this.props.users;

        return (
            <tr>
                <td>{this.props.rowNum}</td>
                <td>{name}</td>
                <td>{email}</td>
                <td>{accessLevel}</td>
            </tr>
        )
    }
}
